import "./App.css";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import HomePageApartments from "./components/ApartmentComponents/HomePageApatments";
import SideBar from "./components/SideBar";
import ApartmentProfile from "./components/ApartmentComponents/ApartmentProfile";
import CreateTenant from "./components/tenantComponents/CreateTenant";
import HomePageMenu from "./components/HomeComponents/HomePageMenu";
import AboutMe from "./components/MyProfileComponents/AboutMe";
import { Grid, Typography, Paper, darken } from "@material-ui/core";
// import Switch from "@mui/material/Switch";
import { ThemeProvider, createMuiTheme } from "@material-ui/core/styles";
import React from "react";
import FormControlLabel from "@mui/material/FormControlLabel";
import { styled } from "@mui/material/styles";

function App() {
  // const [darkMode, setDarkMode] = React.useState(true);
  const darkTheme = createMuiTheme({
    palette: {
      type: "dark",
      background: {
        default: "#000000",
        paper: "#000000",
      },
      text: {
        primary: "#fff",
      },
    },
  });
  const whiteTheme = createMuiTheme({
    palette: {
      type: "light",
    },
  });

  return (
    <ThemeProvider theme={darkTheme}>
      <Paper style={{ height: "100vh" }}>
        <BrowserRouter>
          {/* <SideBar /> */}
          <Switch>
            <Route path="/aboutMe" component={AboutMe} />
            <Route path="/" component={HomePageMenu} />
          </Switch>
        </BrowserRouter>
      </Paper>
    </ThemeProvider>
  );
}

export default App;
